    true,nt"url": null,nt"notes": "The FMCSA Safety and Fitness Electronic
    Records (SAFER) System offers company safety data and related services to industry
    and the public over the Internet. Users can search FMCSA databases, register for
    a USDOT number, pay fines online, order company safety profiles, challenge FMCSA
    data using the DataQs system, access the Hazardous Material Route registry, obtain
    National Crash and Out of Service rates for Hazmat Permit Registration, get printable
    registration forms and find information about other FMCSA Information Systems.",nt"license_title":
